import React, { Component } from 'react';

class Test extends Component {
  state = {items: []}

  componentDidMount() {
    fetch('/')
      .then(res => res.json())
      .then(items => this.setState({ items }));
  }

  render() {
    return (
      <div className="Test">
        <h1>Users</h1>
        {this.state.items.map(item =>
          <div key={item.id}>{item.item}</div>
        )}
      </div>
    );
  }
}

export default Test;
